export interface EventDimension {
    name: string;
    category?: string | string[];
    event_type?: string | string[];
    src?: string;
    result_type?: string;
    message?: string;
    extra_info?: object | string;
    yoda_version?: string;
    webview_type?: string;
    is_official?: 1;
}
export interface ActionStartDimension {
    name: string;
    extra_info?: object;
}
export interface ActionEndDimension {
    name: string;
    extra_info?: object;
    result_type?: string;
}
export interface EventValue {
    duration?: number;
    event_count?: number;
}
export interface SeedEventQueue {
    type: 'event';
    dimension: EventDimension;
    value: EventValue;
}
